

//import D3HierarchyTree from './d3HierarchyTree';

import MatterportContext from '../Matterport/MatterportContext';
import OverlayContext from './OverlayContext';
import GlobalContext from '../../context/globalContext';

import MiniMap from './MiniMap/MiniMap'
import HierarchyTree from './HierarchyTree/HierarchyTree'
import ModelPopup from './ModelPopUp/ModelPopup';
import './menuOverlay.scss'

import { useState, useContext, useEffect } from 'react';
import useSound from 'use-sound';


import { BiChevronLeft } from 'react-icons/bi';
import { FaRuler } from 'react-icons/fa';
import { GrAddCircle } from 'react-icons/gr';
import { TbGauge, TbAlertCircle, TbCapture } from 'react-icons/tb';
import { MdOndemandVideo } from 'react-icons/md';
import { VscTypeHierarchySub } from 'react-icons/vsc';
import { BsMap } from "react-icons/bs";
import { AiOutlineClose } from "react-icons/ai";
import { HiCubeTransparent } from "react-icons/hi";

import ModelPreview from './ModelPreview/ModelPreview';

function MenuOverlay() {
  const [activateToogle, setActivateToogle] = useState(false);
  const [currentVideo3d, setCurrentVideo3d] = useState(null);
  const [currentAnimatedFbx, setCurrentAnimatedFbx] = useState(null);
  const [controlFbx, setControlFbx] = useState(null);

  const [buttonDisabled, setButtonDisabled] = useState(false);

  const {
    currentNodeSelected,
    setisDetailsClosed,
    activeButtonSensorsIcons,
    openedMiniMap,
    setOpenedMiniMap,
    toogleModelPopup,
    setShowModelPreview,
    showModelPreview,
    toogleHierarchy,
    setToogleHierarchy,
    setModelQueries,
    currentModels
  } = useContext(OverlayContext);

  const handleClick = () => {
    if(currentNodeSelected !== (undefined && null)){
      if (buttonDisabled === false) {
        setModelQueries(true)
        setToogleModel(!toogleModel)
        setButtonDisabled(true);
        setTimeout(() => {
          setButtonDisabled(false);
        }, 500);
      }
    }
  };

  const loadFBXMatterport = async () => {
    const [sceneObject] = await sdkMatterport.Scene.createObjects(1);
    const node = sceneObject.addNode();

    node.obj3D.position.set(40.320369720458984, 0.11754655838012695, -27.24587059020996);
    const initial = {
      url: process.env.REACT_APP_DOMAIN + "/static/files/3d/" + "DanceMoves.FBX",
      visible: true,
      localScale: {
        x: .01,
        y: .01,
        z: .01
      },
      localPosition: {
        x: 0, y: 0, z: 0
      },
      localRotation: {
        // x: model.rotationx, y: model.rotationy, z: model.rotationz
        x: 0, y: 0, z: 0
      }
    };

    var initial2 = {
      enabled: true,
      color: {
        r: 1, g: 1, b: 1
      },
      intensity: 3,
    };

    node.addComponent('mp.ambientLight', initial2);
    let modelo = node.addComponent(sdkMatterport.Scene.Component.FBX_LOADER, initial);
    const nodeControl = sceneObject.addNode();
    const myControl = nodeControl.addComponent('mp.transformControls');
    myControl.events[sdkMatterport.Scene.InteractionType.CLICK] = true;
    myControl.events[sdkMatterport.Scene.InteractionType.ROTATE] = true;
    myControl.events[sdkMatterport.Scene.InteractionType.LONG_PRESS_END] = true;
    myControl.events[sdkMatterport.Scene.InteractionType.HOVER] = true;
    myControl.events[sdkMatterport.Scene.InteractionType.DRAG_END] = true;

    nodeControl.start();
    myControl.inputs.mode = 'rotate';
    myControl.inputs.selection = node;
    nodeControl.TYPE = "MODEL";
    node.start();


    document.getElementById("showcase").contentDocument.activeElement.addEventListener("keyup", (e) => {

      if (e.key === "r") {
        myControl.inputs.mode = 'rotate';
      }
      if (e.key === "m") {
        myControl.inputs.mode = 'translate';
      }
      if (e.key === "v") {
        myControl.inputs.mode = 'scale';
      }
    })
    const threejs = modelo.context.three;
    setCurrentAnimatedFbx(node);
    setControlFbx(myControl);
    return { modelo };


  }
  const loadVideoCUbe = async () => {
    const [sceneObject] = await sdkMatterport.Scene.createObjects(1);
    const node = sceneObject.addNode();

    node.obj3D.position.set(38, 0, -26.020);
    const initial = {
      url: process.env.REACT_APP_DOMAIN + "/static/files/3d/" + "plano2.fbx",
      visible: true,
      localScale: {
        x: .01,
        y: .01,
        z: .01
      },
      localPosition: {
        x: 0, y: 0, z: 0
      },
      localRotation: {

        x: 0, y: 90, z: 0
      }

    }
    setCurrentVideo3d(node);
    let modelo = node.addComponent(sdkMatterport.Scene.Component.FBX_LOADER, initial);
    node.start();
    return modelo
  }

  useEffect(() => {
    if (activateToogle) {
      if (sdkMatterport && (currentAnimatedFbx === null && currentVideo3d === null)) {
        loadFBXMatterport().then(res => {
          setTimeout(() => {
            const root = res.modelo.context.root.obj3D.children[1].children[0];
            const threejs = res.modelo.context.three;
            const mixer = new threejs.AnimationMixer(root)
            const clock = new threejs.Clock();
            const idle = mixer.clipAction(root.animations[0])
            idle.play();

            function animate() {
              const deltaTime = clock.getDelta();
              mixer.update(deltaTime);
              requestAnimationFrame(animate);
            }

            animate();

          }, 2000);
        })

        loadVideoCUbe()
          .then(res => {
            setTimeout(() => {
              const threejs = res.context.three;
              let video = document.getElementById("video");
              let videoTexture = new threejs.VideoTexture(video);
              //PostProccesado
              videoTexture.minFilter = threejs.LinearFilter;
              videoTexture.magFilter = threejs.LinearFilter;

              //Video Material
              let movieMaterial = new threejs.MeshBasicMaterial({
                map: videoTexture,
                side: threejs.FrontSide,
                toneMapped: false
              });
              let cubo = res.context.root.obj3D.children[0].children[0].children[0];
              const material2 = new threejs.MeshBasicMaterial({ color: 0xFF1493 });
              cubo.material = movieMaterial;
              function animate() {
                videoTexture.needsUpdate = true;
                requestAnimationFrame(animate);
              }

              animate();
            }, 2000);


          });
        document.getElementById("video").play();
      } else if (currentAnimatedFbx !== null && currentVideo3d !== null) {
        document.getElementById("video").play();
        currentAnimatedFbx.obj3D.visible = true;
        currentVideo3d.obj3D.visible = true;
        controlFbx.context.root.obj3D.children[0].visible = true;
      }

    } else {
      if (currentAnimatedFbx !== null && currentVideo3d !== null && controlFbx !== null) {
        currentAnimatedFbx.obj3D.visible = false;
        currentVideo3d.obj3D.visible = false;
        controlFbx.context.root.obj3D.children[0].visible = false;
        document.getElementById("video").pause();
      }

    }
  }, [activateToogle])

  const {
    toogleModel,
    setToogleModel,
    activeSensors,
    setActiveSensors,
    activeMeasure,
    setActiveMeasure,
    sdkMatterport,
    setactiveVideo3D,
    setloadEmptyModel

  } = useContext(MatterportContext);

  const { logged } = useContext(GlobalContext)
  let screenShotFlag = true;
  const resolution = {
    width: 1920,
    height: 1080
  };

  const visibility = {
    mattertags: false,
    sweeps: false
  };

  const audioShutter = "data:audio/wav;base64,";

  const [play] = useSound(audioShutter);

  const toogle = () => {
    setisDetailsClosed(true);
    setToogleHierarchy(!toogleHierarchy);

  }
  const toogleMiniMap = () => {
    setOpenedMiniMap(!openedMiniMap);
  }
  const takeScrenshoot = async () => {
    if (screenShotFlag) {
      screenShotFlag = false;
      play();
      sdkMatterport.Renderer.takeScreenShot(resolution, visibility)
        .then(function (imageB64) {

          const nameImage = getNameImage();

          saveImage(imageB64, nameImage);
        });
    }

  }

  const getNameImage = () => {
    const currentDate = new Date();
    const date = `${currentDate.getDate()}-${currentDate.getMonth() + 1}-${currentDate.getFullYear()}`;
    const currentTime = `${currentDate.getHours()}-${currentDate.getMinutes()}-${currentDate.getSeconds()} hrs`;
    const currentBuilding = localStorage.getItem('siteName') !== (null && undefined) ? localStorage.getItem('siteName') : "";

    return `${currentBuilding} --- ${date} --- ${currentTime}.png`;
  }

  const saveImage = (imageBlob, nameFile) => {
    const tempLink = window.document.createElement("a");

    tempLink.style = "display:none;";
    tempLink.download = nameFile;
    tempLink.href = imageBlob;

    document.body.appendChild(tempLink);
    tempLink.click();
    document.body.removeChild(tempLink);

    tempLink.remove()

    screenShotFlag = true;
  }

  return (
    <>


      <div className='parent-overlay no-pointer-events overlayMenu'>
        <div className='section-right-o'>
          <div id="hierarchy-minimize-btn" className="hierarchy-minimize mt-2 ms-2 pointer-events pointer-hand"
            onClick={toogle}
          >
            {toogleHierarchy ? <VscTypeHierarchySub /> : <BiChevronLeft />}
          </div>
          <div className="hierarchy-info ms-1">

            <HierarchyTree hide={toogleHierarchy} className="hierarchyComponent" />
            <div className="marginHierarchyComponent">
            </div>
          </div>
        </div>
        <div className='section-left-o'>

          <div className="upper">
            <div className="miniMapParent">
              <MiniMap></MiniMap>
            </div>
            <div className="miniMapCloseOpenParent">
              <div className="hierarchy-minimize mt-2 me-2 pointer-events pointer-hand"
                onClick={toogleMiniMap}
              >
                {openedMiniMap ? <AiOutlineClose /> : <BsMap />}
              </div>
            </div>
          </div>
          {
            logged && showModelPreview ?
              <div id='preview-container'>
                <ModelPreview />
              </div> : <></>
          }
          <div className="ModelPopUp">
            <ModelPopup active={toogleModelPopup} />
          </div>
          <div className='lower'>
            {logged ?
              <>
                <div className='icon-button-container buttonMeasurement mb-2 me-2 pointer-events'>
                  <HiCubeTransparent className='icon-button-mesure pointer-hand' onClick={() =>
                    setloadEmptyModel(true)
                  }>
                  </HiCubeTransparent>
                </div>
                <div className='icon-button-container buttonMeasurement mb-2 me-2 pointer-events'>

                  <GrAddCircle className='icon-button-mesure pointer-hand' onClick={() => setShowModelPreview(true)
                  }></GrAddCircle>
                </div>
              </>
              : <></>
            }
            <div className='icon-button-container buttonMeasurement mb-2 me-2 pointer-events'>
              <TbCapture className='icon-button-mesure pointer-hand' onClick={takeScrenshoot}></TbCapture>
            </div>
            <div className='icon-button-container buttonMeasurement mb-2 me-2 pointer-events'>
              <FaRuler className='icon-button-mesure pointer-hand' onClick={() => setActiveMeasure(!activeMeasure)}></FaRuler>
            </div>
            <div className='icon-button-container buttonMeasurement mb-2 me-2 pointer-events'>
              <MdOndemandVideo className='icon-button-mesure pointer-hand' onClick={() => {
                setactiveVideo3D(true);
                //   setActivateToogle(!activateToogle);
              }}></MdOndemandVideo>
            </div>
            <div className='icon-button-container buttonSensors mb-2 me-2 pointer-events'>
              {activeButtonSensorsIcons ?
                <TbGauge className='icon-button-sensors pointer-hand' onClick={() => setActiveSensors(!activeSensors)}></TbGauge>
                :
                <TbGauge className='icon-button-sensors icon-button-disabled pointer-forbidden'></TbGauge>
              }
            </div>
            <div className='icon-button-container buttonModels mb-2 me-2 pointer-events'

            >
              {
                currentModels !== "undefined" ? 
                <TbAlertCircle
                className={`icon-button-security ${toogleModel && currentNodeSelected !== ("undefined" || "null") ? 'icon-button-disabled' : 'pointer-hand'}`}
                onClick={handleClick}
                >
                </TbAlertCircle>
                :

                <TbAlertCircle
                  className={`icon-button-security icon-button-disabled pointer-forbidden`}
                >
                </TbAlertCircle>
              }
            </div>
          </div>
        </div>
      </div>
    </>
  )
}

//Measures
//SEnsors
//security info
export default MenuOverlay